import '../../../data/models/percentage_opportunty_dto.dart';class PercentageOpportunty {  PercentageOpportunty({    this.name,    this.percentage,    this.label,    this.count,  });  String? name;  num? percentage;  String? label;  num? count;  factory PercentageOpportunty.fromDto(PercentageOpportuntyDto dto) {    return PercentageOpportunty(      name: dto.name,      percentage: dto.percentage,      label: dto.label,      count: dto.count,    );  }}